package Practice;

public class Ifelseif_block {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=100;
		int b=200;
		int c=200;
		if (a!=b)
		{
			System.out.println("If block");
		}
		else if (b==c)
		{
			System.out.println("Else if block");
		}
		else
		{
			System.out.println("Else block");
		}
	}

}
